import React from 'react';

const TaskList = ({ tasks }) => {
  return (
    <ul className="divide-y">
      {tasks.map(task => (
        <li key={task._id} className="py-2">
          <h3 className="font-semibold">{task.name}</h3>
          <p>Status: {task.status}</p>
        </li>
      ))}
    </ul>
  );
};

export default TaskList;
